import { Link } from "react-router-dom";

import usuarios from "../Pruebas/usuarios.json";
import DataTable from "react-data-table-component";

function GestionUsuarios() {

  const columnas = [
    {
      name: "CÓDIGO",
      selector: "id",
      sortable: true
    },
    {
      name: "P NOMBRE",
      selector: "pNombre",
      sortable: true
    },
    {
      name: "S NOMBRE",
      selector: "sNombre",
      sortable: true
    },
    {
      name: "P APELLIDO",
      selector: "pApellido",
      sortable: true
    },
    {
      name: "CÉDULA",
      selector: "cedula",
      sortable: true
    },
    {
      name: "CORREO",
      selector: "correo",
      sortable: true
    },
    {
      name: "F DE CREACIÓN",
      selector: "fCreacion",
      sortable: true
    },
    {
      name: "ULTIMO ACCESO",
      selector: "fAcceso",
      sortable: true
    }
  ]

  return (
    <div className="mx-auto ">
      <h2 style={{ color: "#2E4053" }}>
        <center>
          <b>GESTIÓN DE USUARIOS</b>
          <br />
          <h1>filtros de busqueda</h1>
        </center>
      </h2>
      <br />
      <DataTable 
      columns={columnas}
      data={usuarios}
      pagination
      />

    </div>
  );
}

export default GestionUsuarios;
